import React from "react";
import styled from "styled-components";

// interface IPage extends IProducts {
//   picture: string;
// }

const Products = ({ product }) => {
  return (
    <Wrapper>
      <div className="card">
        <img src={product.picture} alt="" />
        <p>Tag: SoftWare</p>
      </div>
    </Wrapper>
  );
};

export default Products;

const Wrapper = styled.div`
  margin-bottom: 1rem;
  img {
    width: 100%;
    height: 100%;
    max-height: 20px;
  }
`;
